import React from 'react';

import '../App.css';

const ContainerTypeCategory = ({ containerTypeCategory }) => {
  return (
    <div className="flex flex-row" key={containerTypeCategory.id}>
      <div className="flex-col-1">
        <a href={`/containerTypeCategories/${containerTypeCategory.id}`}>{containerTypeCategory.name}</a>
      </div>
      <div className="flex-col-2">
        {containerTypeCategory.description}
      </div>
    </div>
  );
}

export default ContainerTypeCategory;
